import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";
import NavigationBar from './components/NavigationBar';
import Home from './pages/Home';
import { Stocks } from "./Stocks";

function App() {
  return (
    <div className="App">
<Router>
<div>
          <NavigationBar />
          <Stocks />
        </div>
<Route exact path='/' component={Home} />
</Router>

    </div>
  );
}

export default App;
